import axios from "axios";
import React, { useState, useEffect } from "react";
import { useParams } from "react-router-dom";
function ExampleOfPhonetic() {
  const { name } = useParams();
  const { REACT_APP_HOST } = process.env;
  const [PhoneticsExamples, SetPhoneticsExamples] = useState([]);
  const fetchData = async () => {
    try {
      const { data: response } = await axios.get(
        `${REACT_APP_HOST}getPhoneticExamples.php/?limit=${name}`
      );
      SetPhoneticsExamples(response);
      console.log(response);
    } catch (error) {
      console.error(error.message);
    }
  };

  useEffect(() => {
    fetchData();
  }, []);
  return (
    <div className="midde_cont">
      <div className="container-fluid">
        <div className="row column_title">
          <div className="col-md-12">
            <div className="page_title">
              <h2>Phonetics Examples for Letter {name}</h2>
            </div>
          </div>
        </div>
        <div className="row column1"></div>
      </div>
    </div>
  );
}
export default ExampleOfPhonetic;
